import React from "react";
import { Link } from 'react-router-dom';
import '../dashboard.css';
import Card from "../Card";

import {useEffect, useState } from 'react';
import axios from 'axios';

const Dashboard = ()=>{
    const [addEdit,setAddEdit] = useState(false);
    const [changeName,setChangeName] = useState('Ajouter');
    const [listRecettes,setListRecettes] = useState([]);
    const [nomText,setNomText] = useState('nom');
    const [descriptionText,setDescriptionText] = useState('desc');
    const [ingredientText,setIngredientText] = useState('ingredient');
    const [instructionText,setInstructionText] = useState('instruction');

    useEffect(()=>{
        const getRecettesList = async ()=>{
          try {
            const res = await axios.get('http://localhost:3001/api/v1/recettes');
            setListRecettes(res.data);
            console.log('render');
          } catch (err) {
            console.log(err);
          }
        }
        getRecettesList();
      },[]);

      const addItem = async (e)=>{
        e.preventDefault();
        try {
          const res = await axios.post('http://localhost:3001/api/v1/recettes',{recettes: [nomText,descriptionText,ingredientText,instructionText]});
          setListRecettes((prev)=>[...prev,res.data]);
          console.log(listRecettes);
          setNomText('');
          setDescriptionText('');
          setIngredientText('');
          setInstructionText('');
        } catch (err) {
          console.log(err+" mauvais ");
        }
      }  

    const openClose = ()=>{
        setAddEdit(!addEdit);
        if(!addEdit){
            setChangeName("voir la liste");
        }else{
            setChangeName("Ajouter");
        }
    }
    return(
        <>
            <header className="header2">
            <h1>Dashboard</h1>
            <a><Link to="/">deconnexion</Link></a>
            </header>
            <main className="main2">
                <button className="add" onClick={openClose}>{changeName}</button>
                    {addEdit && (
                        <div>
                            <form  className="form2"  onSubmit={(e)=> addItem(e)}>
                                <h1>Ajouter ou modifier</h1>
                                <div>
                                    <input type="text" placeholder="nom" />
                                </div>
                                <div>
                                    <input type="text" placeholder="description" />
                                </div>
                                <div>
                                    <input type="text" placeholder="ingredients" />
                                </div>
                                <div>
                                    <input type="text" placeholder="instructions" />
                                </div>
                                
                                <div>
                                    <button type="submit">Valider</button>
                                </div>
                            </form>
                        </div>
                    )
                    }
                    {!addEdit &&(
                        <table>
                        <tr>
                            <th>nom</th>
                            <th>description</th>
                            <th>ingredients</th>
                            <th>instruction</th>
                        </tr>
                        {
                            (listRecettes.map((listRecette)=>(
                                <tr>
                            <td>{listRecette.nom}</td>
                            <td>{listRecette.description}</td>
                            <td>{listRecette.ingrédients}</td>
                            <td>{listRecette.instructions}</td>
                            <td><button className="edit" onClick={openClose}>modifier</button></td>
                            <td><button className="delete">supprimer</button></td>
                        </tr>
                            )))
                        }
                        
                    </table>
                    )

                    }
                
                
            </main>
        </>
    );
}

export default Dashboard;
